export interface Logger {
    debug(
        title: string, description: string, context?: any,
    ): void;

    error(
        title: string, description: string, context?: any,
    ): void;

    warn(
        title: string, description: string, context?: any,
    ): void;

    info(
        title: string, description: string, context?: any,
    ): void;
}
